(4, 'propostas', 'Nova Solicitação Proposta - user criador', 'Portal Conecta - Solicitação de Proposta Recebida', '&lt;p&gt;Ol&amp;aacute;, [nome_criador]! Sua solicita&amp;ccedil;&amp;atilde;o foi recebida e j&amp;aacute; est&amp;aacute; em processo de an&amp;aacute;lise.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Produto:&lt;/strong&gt; [tipo_produto]&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Dr(a):&lt;/strong&gt; [doutor]&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Paciente:&lt;/strong&gt; [paciente]&lt;/p&gt;\r\n&lt;p&gt;Para mais informa&amp;ccedil;&amp;otilde;es acesse o portal conecta pelo link https://conecta.cpmhdigital.com.br/minhassolicitacoes e acompanhe o andamento da sua proposta.&lt;/p&gt;\r\n&lt;div&gt;&lt;span style=&quot;color: #95a5a6;&quot;&gt; &lt;small&gt;Caso voc&amp;ecirc; n&amp;atilde;o tenha realizado essa solicita&amp;ccedil;&amp;atilde;o, mude sua senha na plataforma para sua seguran&amp;ccedil;a e nos comunique para verifica&amp;ccedil;&amp;atilde;o de usu&amp;aacute;rio.&lt;/small&gt; &lt;/span&gt;&lt;/div&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: #95a5a6;&quot;&gt; &lt;small&gt;&amp;copy; Portal Conecta 2022&lt;/small&gt;&lt;/span&gt;&lt;/p&gt;', '[nome_criador]', 'vanessa', '20/12/2021 09:54:19', '25/02/2022 00:02:33', ''),
