(7, 'propostas', 'Proposta Enviada - user criador', 'Portal Conecta - Devolutiva Proposta', '&lt;p&gt;Ol&amp;aacute;, [nome_criador]! Sua proposta N&amp;deg; [num_proposta]&amp;nbsp; j&amp;aacute; est&amp;aacute; dispon&amp;iacute;vel para confer&amp;ecirc;ncia.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Produto:&lt;/strong&gt; [tipo_produto]&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;Dr(a):&lt;/strong&gt; [nome_dr]&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;Paciente:&lt;/strong&gt; [nome_paciente]&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Entre no Portal Conecta e verifique seus dados para aceitar a proposta.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;Caso voc&amp;ecirc; n&amp;atilde;o tenha realizado essa solicita&amp;ccedil;&amp;atilde;o, mude sua senha na plataforma para sua seguran&amp;ccedil;a e nos comunique para verifica&amp;ccedil;&amp;atilde;o de usu&amp;aacute;rio.&lt;br /&gt;&lt;br /&gt;&lt;span style=&quot;color: #95a5a6; font-size: 13.3333px;&quot;&gt;&amp;copy; Portal Conecta 2022&lt;/span&gt;&lt;/p&gt;', '[nome_criador]', 'vanessa', '20/12/2021 10:23:43', '23/02/2022 11:19:49', ''),
(8, 'propostas', 'Proposta Aceita - comercial', 'Portal Conecta - Proposta Aceita', '&lt;p&gt;Ol&amp;aacute;, Comercial! A Proposta N&amp;ordm; [num_proposta] foi aceita pelo cliente. O recibo de pagamento est&amp;aacute; sob an&amp;aacute;lise do Financeiro, aguarde atualiza&amp;ccedil;&amp;otilde;es.&lt;br /&gt;&lt;br /&gt;Produto: [tipo_produto]&lt;br /&gt;&lt;br /&gt;Dr(a): [nome_dr]&lt;br /&gt;&lt;br /&gt;Paciente: [nome_paciente]&lt;br /&gt;&lt;br /&gt;Para mais informa&amp;ccedil;&amp;otilde;es acesse o portal conecta pelo link https://conecta.cpmhdigital.com.br/comercial e altere os dados da proposta.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size: 10pt; color: #95a5a6;&quot;&gt;&amp;copy; Portal Conecta 2022&lt;/span&gt;&lt;/p&gt;', '[sistema_emailComercial]', 'vanessa', '20/12/2021 11:10:34', '25/02/2022 00:03:14', ''),
